script: |
  super -f text -I q786.spq | sort > q786.out

inputs:
  - name: q786.spq
    data: |
      SELECT DISTINCT cor0.col2 + - col2 * - col1 / col1 + - 23 * - cor0.col2 AS col0 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q786.out
    data: |
      2050
      25
      825
